import styled from "styled-components";

export const LJRankingListWrapper = styled.div`
  padding: 0 30px 40px 40px;

  table {
    width: 100%;
    border: 1px solid #d9d9d9;

    thead {
      .ranking {
        width: 77px;
      }
    }

    th {
      height: 38px;
      background-color: #f7f7f7;
      background-position: 0 0;
      background-repeat: repeat -x;
    }
  }
`;
